script: |
  super -f text -I q7798.spq | sort > q7798.out

inputs:
  - name: q7798.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col2 / + col0 / - 24 NOT BETWEEN - - col2 * + 85 AND col1;
  - name: tab1

outputs:
  - name: q7798.out
    data: |
      51	14	96
      85	5	59
      91	47	68
